(function (skTelstra) {
  'use strict'
  /**
   * @memberOf skTelstra
   * @namespace skTelstra.dataService
   * @type {{init: init}}
   */
  skTelstra.dataService = {

    init: function () {
      var data = skTelstra.data

      var categories = ['overall_environment', 'innovation_and_entrepreneurship', 'financial_environment', 'people_and_skills', 'development_of_new_technologies', 'ict_infrastucture']
      var industries = [
        {
          key: 'agribusiness',
          name: 'Agribusiness'
        },
        {
          key: 'education',
          name: 'Education'
        },
        {
          key: 'financial_services',
          name: 'Financial Services'
        },
        {
          key: 'logistics_and_transport',
          name: 'Logistics & Transport'
        },
        {
          key: 'manufacturing',
          name: 'Manufacturing'
        },
        {
          key: 'media_and_broadcasting',
          name: 'Media & Broadcasting'
        },
        {
          key: 'mining',
          name: 'Mining'
        },
        {
          key: 'oil_and_gas',
          name: 'Oil & Gas'
        },
        {
          key: 'professional_services',
          name: 'Professional Services'
        },
        {
          key: 'retail',
          name: 'Retail'
        },
        {
          key: 'utilities',
          name: 'Utilities'
        }
      ]

      function getMaxMinScores () {
        var max
        var min
        for (var i = 0; i < categories.length; i++) {
          var rankingSection = data.ranking[categories[i]]
          for (var j = 0; j < rankingSection.length; j++) {
            var score = rankingSection[j].score
            if (!max) {
              max = score
            } else {
              if (score > max) {
                max = score
              }
            }

            if (!min) {
              min = score
            } else {
              if (score < min) {
                min = score
              }
            }
          }
        }

        return {
          max: max,
          min: min
        }
      }

      /**
       * Get the industry scores for all regions with a given category.
       *
       * @param {String} category
       * @returns {Array}
       */
      function getRegionIndustryScores (category) {
        var scores = []
        for (var k = 0; k < industries.length; k++) {
          var industry = industries[k]
          var regionScores = skTelstra.data.region_ranking[industry.key][category]
          var industryName = industry.name
          scores.push({
            industryName: industryName,
            regionScores: regionScores
          })
        }

        return scores
      }

      /**
       *  Returns an array of city scores for array
       *
       * @param {Array} cityOrCities - An array of one or more city string
       * @returns {Array} - An array of arrays, each representing the city scores in order
       */
      function getCityScores (cityOrCities) {
        var results = []
        for (var i = 0; i < categories.length; i++) {
          var rankingSection = data.ranking[categories[i]]
          for (var j = 0; j < rankingSection.length; j++) {
            var city = rankingSection[j].country
            var indexOfCity = cityOrCities.indexOf(city)
            if (indexOfCity !== -1) {
              if (!results[indexOfCity]) {
                results[indexOfCity] = []
              }
              results[indexOfCity].push({
                score: rankingSection[j].score,
                rank: rankingSection[j].rank,
                city: rankingSection[j].country
              })
            }
          }
        }
        return results
      }

      /**
       * When passed a ranking element will append relevant html and a class if it's rank is 1
       *
       * @param {Element} element - Element to which the html and class will be applied.
       * @param {int | float} ranking - number representing the rank
       * @param {float} score - The score, which will be converted to two decimals.
       */
      function checkRankingClass (element, ranking, score) {
        element.classList.remove('sk-ranking-number--1')
        element.classList.remove('sk-ranking-number--2')
        element.classList.remove('sk-ranking-number--3')
        element.classList.remove('sk-ranking-number--4')
        element.classList.add('sk-ranking-number--' + ranking)
        element.innerHTML = '<span>' + score.toFixed(2) + '</span>' + '<span><i>Rank: </i>' + ranking + '</span>'
      }

      this.getMaxMinScores = getMaxMinScores
      this.getCityScores = getCityScores
      this.getRegionIndustryScores = getRegionIndustryScores
      this.checkRankingClass = checkRankingClass
    }
  }
}(window.skTelstra = window.skTelstra || {}, jQuery))
