    var cityOneSelectEle = containerEle.querySelector('.js-city-one-select')
    var cityTwoSelectEle = containerEle.querySelector('.js-city-two-select')
    var containerEle = document.querySelector('.js-sk-rankings')
    var cityOne = cityOneSelectEle.value
    var cityTwo = cityTwoSelectEle.value
    var results = skTelstra.dataService.getCityScores([cityOne, cityTwo])
    var rows = containerEle.querySelectorAll('.js-scores-row')
