(function (skTelstra) {
  'use strict'

  /**
   * Initialise the city barometer.
   * All subsequent dom querys are scoped to the container.
   *
   * @memberOf skTelstra
   * @namespace skTelstra.detailViews
   * @type {{init: init}}
   */
  skTelstra.detailViews = {

    init: function () {
      var data = skTelstra.data

      $('.js-sk-barometer--industry').slick({
        infinite: true,
        slidesToShow: 6,
        slidesToScroll: 3,
        prevArrow: '<span class="slick-arrow slick-arrow--prev">&lt;</span>',
        nextArrow: '<span class="slick-arrow slick-arrow--next">&gt;</span>',
        responsive: [
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3
            }
          },
          {
            breakpoint: 700,
            settings: {
              slidesToShow: 5,
              slidesToScroll: 3
            }
          }
        ]
      })

      $('.js-sk-barometer--region').slick({
        infinite: true,
        slidesToShow: 4,
        slidesToScroll: 4
      })
    }
  }

  skTelstra.detailViewloadCity = function (city) {
    city = skTelstra.cleanUrl(city)
    var region = skTelstra.data.regions[city]
    var summary = skTelstra.data.summaries.cityDetail[city]
    $('.js-city-name').text(city)
    $('.js-city-summary').text(summary)
    $('.js-region-name').text(region)
    $('.js-city-link').data('value', city)

    for (var i in skTelstra.data.ranking) {
      if (skTelstra.data.ranking.hasOwnProperty(i)) {
        for (var x in skTelstra.data.ranking[i]) {
          if (skTelstra.data.ranking[i][x].country == city) {
            $('.js-' + i + '-score').text(skTelstra.data.ranking[i][x].score.toFixed(2))
            $('.js-' + i + '-score-data').data('score', skTelstra.data.ranking[i][x].score.toFixed(2))
            $('.js-' + i + '-rank').removeClass('detail-stats-row__rank--1')
            $('.js-' + i + '-rank').text(skTelstra.data.ranking[i][x].rank)
            if (skTelstra.data.ranking[i][x].rank == 1) {
              $('.js-' + i + '-rank').addClass('detail-stats-row__rank--1')
            }
          }
        }
      }
    }

    for (var i in skTelstra.data.region_ranking) {
      if (skTelstra.data.region_ranking.hasOwnProperty(i)) {
        for (var x = 0; x < skTelstra.data.region_ranking[i].overall_environment.length; x++) {
          if (skTelstra.data.region_ranking[i].overall_environment[x].region == region) {
            $(document).find('.js-barometer-score-' + i).data('score', skTelstra.data.region_ranking[i].overall_environment[x].score)
            $(document).find('.js-barometer-score-' + i + ' i').text(skTelstra.data.region_ranking[i].overall_environment[x].score.toFixed(2))
          }
        }
      }
    }

    skTelstra.generateSurveyData(city, '.js-detail-survey-data')
    skTelstra.drawDetailStats()
    skTelstra.drawBarometerStats()
    $('.js-selected').removeClass('js-selected')
    $('.tabbed-nav--cities-barometer a[href="#' + city + '"]').addClass('js-selected')
  }

  skTelstra.detailViewloadIndustry = function (industry) {
    var skindustry = industry
    industry = skTelstra.cleanUrl(industry)
    var summary = skTelstra.data.summaries.industryDetail[industry]
    $('.js-industry-name').text(industry)
    $('.js-industry-summary').text(summary)

    for (var i in skTelstra.data.industry_ranking) {
      if (skTelstra.data.industry_ranking.hasOwnProperty(i)) {
        for (var x in skTelstra.data.industry_ranking[i]) {
          if (skTelstra.data.industry_ranking[i][x].industry == industry) {
            $('.js-' + i + '-score').text(skTelstra.data.ranking[i][x].score.toFixed(2))
            $('.js-' + i + '-score-data').data('score', skTelstra.data.ranking[i][x].score.toFixed(2))
            $('.js-' + i + '-rank').removeClass('detail-stats-row__rank--1')
            $('.js-' + i + '-rank').text(skTelstra.data.ranking[i][x].rank)
            if (skTelstra.data.ranking[i][x].rank == 1) {
              $('.js-' + i + '-rank').addClass('detail-stats-row__rank--1')
            }
          }
        }
      }
    }

    industry = skTelstra.processUrl(industry.toLowerCase())
    for (var x = 0; x < skTelstra.data.region_ranking[industry].overall_environment.length; x++) {
      var item = skTelstra.data.region_ranking[industry].overall_environment[x]
      $('.js-barometer-score-' + item.region.replace(/ /g, '_')).data('score', item.score)
      $('.js-barometer-score-' + item.region.replace(/ /g, '_') + ' i').text(item.score.toFixed(2))
    }

    skTelstra.drawDetailStats()
    skTelstra.drawBarometerStats()
    $('.js-selected').removeClass('js-selected')
    $('.tabbed-nav--industries-barometer a[href="#' + skindustry + '"]').addClass('js-selected')
  }

  skTelstra.processUrl = function (string) {
    return string.replace(/&/g, 'and').replace(/ /g, '_')
  }

  skTelstra.cleanUrl = function (string) {
    return string.replace(/and/g, '&').replace(/_/g, ' ').replace(/#/g, '')
  }

  skTelstra.rangeToPercent = function (number, min, max) {
    return ((number - min) / (max - min)) * 100
  }

  skTelstra.drawDetailStats = function () {
    // calulate the % requirements.
    // 5.8 = 0;
    // 8.2 = 100
    var base = 5.7
    var max = 8.8
    var timeout = 0

    $('.js-active .js-stats-row .detail-stats-row__data em').each(function () {
      var score = $(this).data('score')
      var percentage = skTelstra.rangeToPercent(score, base, max)
      var that = $(this)

      setTimeout(function () {
        that.css('marginLeft', percentage + '%')
      }, timeout * 200)

      timeout++
    })
  }

  skTelstra.drawBarometerStats = function () {
    // calulate the % requirements.
    // 5.8 = 0;
    // 8.2 = 100
    var base = 4.5
    var max = 8.1
    var timeoutBar = 0

    $('.js-active .js-barometer-score').each(function () {
      var score = $(this).data('score')
      var percentage = skTelstra.rangeToPercent(score, base, max)
      var that = $(this)

      setTimeout(function () {
        that.css('width', percentage + '%').css('height', percentage + '%')
      }, timeoutBar * 200)

      timeoutBar++
    })
  }
}(window.skTelstra = window.skTelstra || {}, jQuery));
